export const initialState = {
    avatar: '',
    userservices: [],
    useravailability: []
};

export const UserReducer = (state, action) => {
    switch (action.type) {
        case 'setAvatar':
                return {...state, avatar: action.payload.avatar};
            break;

        default:
            return state;
    }
    switch (action.type) {
        case 'userservices':
                return {...state, userservices: action.payload.userservices};
            break;

        default:
            return state;
    }
    switch (action.type) {
        case 'useravailability':
                return {...state, useravailability: action.payload.useravailability};
            break;

        default:
            return state;
    }
}
